#include <memory>

class GeneralFieldMapTest: public ::testing::Test {
public:
    GeneralFieldMapTest()
    { }
    void SetUp();
    void TearDown();

protected:
    const std::string filename_m = "GeneralFieldMapTest.map";
    OpalTestUtilities::SilenceTest silencer_m;
};

TEST_F(GeneralFieldMapTest, FactoryTest) {
    namespace fs = boost::filesystem;
    ASSERT_TRUE(fs::exists(filename_m));

    Fieldmap* fmap = nullptr;
    EXPECT_NO_THROW(fmap = Fieldmap::getFieldmap(filename_m));
    GeneralFieldMap * gfmap = dynamic_cast<GeneralFieldMap*>(fmap);

    ASSERT_TRUE(gfmap);

    Fieldmap::deleteFieldmap(filename_m);
}

TEST_F(GeneralFieldMapTest, ReadIn) {
    namespace fs = boost::filesystem;

    ASSERT_TRUE(fs::exists(filename_m));

    GeneralFieldMap *field = dynamic_cast<GeneralFieldMap*>(Fieldmap::getFieldmap(filename_m));
    EXPECT_TRUE(field != nullptr);
    EXPECT_NEAR(field->getFrequency(), 1.498953425154e9 * Physics::two_pi, 1e-5);

    ComplexVector_t E, B;
    Vector_t R(0.0, 0.0, 4.1140e-2 + 7.9785e-2);

    field->getFieldstrength(R, E, B);
    EXPECT_NEAR(E.real()(2), -4.0929e+03, 1);
    EXPECT_NEAR(E.imag()(2), -1.0091e+03, 1);

    Fieldmap::deleteFieldmap(filename_m);
}

TEST_F(GeneralFieldMapTest, ReadInFromElement) {
    namespace fs = boost::filesystem;

    ASSERT_TRUE(fs::exists(filename_m));
    PartData pd;
    PartBunch bunch(&pd);

    RFCavityRep rfcavity("TEST");
    rfcavity.setFieldMapFN(filename_m);
    rfcavity.setAmplitude(1.0);
    rfcavity.setFrequencym(1.498953425154e9 * Physics::two_pi);
    rfcavity.setPhasem(0.0);
    double zstart = 0.0, zend;
    rfcavity.initialise(&bunch, zstart, zend);

    Vector_t E, B;
    Vector_t R(0.0, 0.0, 4.1140e-2), P;

    rfcavity.apply(R, P, 0.0, E, B);

    EXPECT_NEAR(E(2), -4.0929e+03, 1);
    EXPECT_NEAR(B(2), 0.0, 1);
}

